import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AnalysisBoard from './AnalysisBoard';
import './styles.css';

const AnalysisBoardPage2 = () => {
    const [orientation, setOrientation] = useState('white');
    const [fen, setFen] = useState('rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1'); // Define the FEN state and its setter function
    const handleEditBoard = () => {
        var T1 = document.getElementById("EditingOn");
        T1.style.display =  T1.style.display==="none"? "block": "none";

        var T2 = document.getElementById("EditingOff");
        T2.style.display =  T2.style.display==="block"? "none": "block";
    };

    const handleFlipBoard = () => {
        setOrientation(orientation === 'white' ? 'black' : 'white');
    };

    const handleFenUpdate = (newFen) => {
        setFen(newFen); // Update the FEN state
    };

    return (
        <div className="landing-page">
            <header>
            <nav>
            <ul>
                        <li><Link to="/"><img height="35px" src="./squarelogo.png" style={{ verticalAlign: 'middle' }} alt="Home" /></Link></li>
                        <li className="features-dropdown">
                            <a href="#">Prepare</a>
                            <ul className="features-dropdown-menu">
                                <li><Link to="/play-stockfish">Play vs Stockfish</Link></li>
                            </ul>
                        </li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><a href="#import-games">Import Games</a></li>
                        <li><a href="#about-us">About Us</a></li>
                    </ul>
                </nav>
            </header>

            <main>
                <div>
                    <AnalysisBoard>{({evaluation, bestLine, goToEnd, goToNextMove, goToPreviousMove, goToStart, fen}) => (
                        <div>
                            <button onClick={goToStart}>Start</button>
                            <button onClick={goToPreviousMove}>Previous</button>
                            <button onClick={goToNextMove}>Next</button>
                            <button onClick={goToEnd}>End</button>
                            <div>
                                <div>Stockfish Eval: {evaluation}</div>
                                <div>Best Continuation Line: {bestLine}</div>
                            </div>
                            </div> 
                    )}</AnalysisBoard>
                    </div>

            </main>
            <footer>
                <p>&copy; 2024 SquareChess. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default AnalysisBoardPage2;
